          <p><span>你防卫性很强，当缺乏安全感时，会退缩到自己的壳里或绕道而行；你非常情绪化，多愁善感，处理问题的方式不够直截了当，倾向干旁敲侧击，拐弯抹角你敏感、有同理心，不但想保护自己，还想保护自己的家族和朋友；你乐意为自己所属的团体做任何事：你从不轻易忽视眼前发生的事，对轻藐的态度尤其敏感，有小题大做的倾向和令人透不过气的掌控性；你有强烈的占有欲，缺乏安全感，不容易忘怀过去，会执着于过往的人事、物；你拥有良好的记忆力；你有收集和囤积的习惯，喜欢古董或能令人回忆起往事的东西；</span></p>
        </div>
